  `transacted_amount` double NOT NULL,
  `transaction_type` enum('0','1') NOT NULL,
  `closing_balance` double NOT NULL,
  `time_stamp` bigint NOT NULL,
  `remarks` varchar(255) NOT NULL,
  `created_at` bigint DEFAULT NULL,
  `modified_by` int DEFAULT NULL,
  `modified_at` bigint DEFAULT NULL,
  PRIMARY KEY (`transaction_id`,`user_id`,`viewer_account_number`),
  KEY `modified_by` (`modified_by`),
  KEY `viewer_account_number` (`viewer_account_number`),
  CONSTRAINT `transactions_ibfk_2` FOREIGN KEY (`modified_by`) REFERENCES `users` (`user_id`),
  CONSTRAINT `transactions_ibfk_3` FOREIGN KEY (`viewer_account_number`) REFERENCES `accounts` (`account_number`) ON UPDATE CASCADE
) ENGINE=InnoDB AUTO_INCREMENT=166 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_0900_ai_ci;
